    /**
     * 获取所有的模块数据
     */
    pub.getAllCTags = function(opts0,cbk){
        var items = pub.getCTags()||[],
            parseTreeData = function(ctag,ptag,opts){
                ctag.pid = ptag.id;
                ctag = parseSingleItem(ctag,ptag,opts);
                if ( (!ctag.babies) || (ctag.babies.length===0) ) {
                    return ctag;
                };
                var len = ctag.babies.length;
                for(var i =0;i<len;i++){
                    parseTreeData(ctag.babies[i],ctag,opts);
                };//for
                return ctag;
            },
            parseSingleItem = function(tempItem,parentItem,opts){
                tempItem.id = tempItem.isCustomYTag?tempItem.id:tempItem.ytagSelector;
                tempItem.ptags = [];
                tempItem.ptagIds =[];
                tempItem.cl1="";
                tempItem.clListSub = "";
                tempItem.hasChildren = false;

                $.extend(tempItem,J.data.defaultPTagData);

                if(tempItem.isCustomYTag){
                    switch(tempItem.type){
                        case 1:
                            //类名
                            tempItem.ptags = J.data.ptag.getDataBySelector(tempItem.ytagSelector);
                        break;
                        case 2:
                            //id
                            tempItem.ptags = J.data.ptag.getDataByIds(tempItem.ytagSelector.split('|'));
                        break;
                    };//switch
                };
                if(tempItem.readonly){
                    tempItem.cl1=' data_list_item1';
                }
                //含子级模块
                if(tempItem.babies&&tempItem.babies.length>0){
                    tempItem.cl1+=' data_list_child';
                    tempItem.clListSub =tempItem.id=='0'?'':' data_list_con1';
                    tempItem.hasChildren = true;
                }
                ytagLen = tempItem.ptags.length;
                for(var j=0;j<ytagLen;j++){
                    tempItem.ptagIds.push(tempItem.ptags[j].page_tag);
                    //付款人数
                    tempItem.DealUser+=tempItem.ptags[j].DealUser;
                    //付款数
                    tempItem.DealCount += tempItem.ptags[j].DealAmount;
                    //订单数
                    tempItem.OrderCount += tempItem.ptags[j].OrderCount;
                    //订单金额
                    tempItem.OrderAmount += tempItem.ptags[j].OrderAmount;

                    //付款率
                    tempItem.DealRate += tempItem.ptags[j].DealRate;
                    //订单率
                    tempItem.OrderRate += tempItem.ptags[j].OrderRate;

                };//for
                
                //订单率和付款率取平均值
                tempItem.DealRate = ytagLen === 0 ? 0 :(tempItem.DealRate/ytagLen);
                tempItem.OrderRate = ytagLen === 0 ? 0 :(tempItem.OrderRate/ytagLen);

                //tempItem.click_trans_rate = tempItem.click_num==0?0:parseFloat( (tempItem.order_num*100/tempItem.click_num).toFixed(2) );
                
                switch(opts.dataType){
                    case 1:
                        tempItem.val = tempItem.OrderCount;
                    break;
                    case 2:
                        tempItem.val = tempItem.OrderRate;
                    break;
                    case 3:
                        tempItem.val = tempItem.DealCount;
                    break;
                    case 4:
                        tempItem.val = tempItem.DealRate;
                    break;
                };
                tempItem = parseSingleItemToday(tempItem,opts);

                //根节点
                if(tempItem.isRoot){
                    delete parentItem['id'];
                    $.extend(tempItem,parentItem);
                };

                //格式化
                tempItem.val1 = opts.dataType===3?tempItem.val:J.formatNum(tempItem.val+'');

                //比例
                tempItem.percent = (parentItem.val==0?0:tempItem.val*100/parentItem.val).toFixed(2);

                //综合分值
                //tempItem.grade = xData.score.init(J.data.CurrentKeyData.total.click_trans_rate,tempItem.click_trans_rate,1).toFixed(1);
                return tempItem;
            },
            parseSingleItemToday = function(tempItem,opts){
                if(opts.isToday){
                    pub.todayModRankDataCache[tempItem.id] = {
                        DealRate:tempItem.DealRate,
                        DealCount:tempItem.DealCount,
                        DealAmount:tempItem.DealAmount,
                        DealUser:tempItem.DealUser,
                        OrderRate:tempItem.OrderRate,
                        OrderCount:tempItem.OrderCount,
                        OrderAmount:tempItem.OrderAmount
                    };
                };
                //TODO:
                var todayItem = pub.todayModRankDataCache[tempItem.id];
                switch(this.dataType){
                    case 1:
                        tempItem.val0 = todayItem.OrderCount;
                    break;
                    case 2:
                        tempItem.val0 = todayItem.OrderRate;
                    break;
                    case 3:
                        tempItem.val0 = todayItem.DealCount;
                    break;
                    case 4:
                        tempItem.val0 = todayItem.DealRate;
                    break;
                };
                return tempItem;
            },
            parseData = function(items,opts){
                items = items||[];
            

                var len = items.length,
                    tempItem = null,
                    cItems = [],
                    ytagLen = 0,
                    parentItem = J.data.getKeyData(opts.dataType);

                for(var i=0;i<len;i++){
                    tempItem = items[i];
                    tempItem = parseSingleItem(tempItem,parentItem,opts);
                    if(tempItem.isCustomYTag){
                        cItems.push(tempItem);
                    };
                };

                if(cItems.length===0){
                    return null;
                }

                //树形数据的递归处理
                var d = {
                    id:'0',
                    babies:cItems,
                    isCustomYTag:true,
                    isRoot:true
                };
                parseTreeData(d,parentItem,opts);

                return d;
            },
            onDataOk = function(items,opts,cbk0){

                items = parseData(items,opts);

                cbk0(items);

            };

        if(!pub.defaultCTags){
            J.data.getDefaultCTags(function(err,d){
                if(err){
                    console.log(i18n.t('ajax.presetModError'),err);
                    
                    onDataOk(items,opts0,cbk);

                    return;
                };
                pub.defaultCTags = d||[];
                items = items.concat(pub.defaultCTags);
                onDataOk(items,opts0,cbk);
            });
            return;
        };
        items = items.concat(pub.defaultCTags);
        onDataOk(items,opts0,cbk);
    };
    /**
     * 获取自定义tag信息
     */
    pub.getCTags = function(rawForm){
        rawForm=rawForm||false;
        var key = 'wgdata_ctags_'+pub.bizInfo.pid,
            rawData = localStorage[key],
            rawData1 = pub.getPrivateModsByCssSelector(),
            isRawData1Empty = Object.getOwnPropertyNames(rawData1).length==0;
        if(!rawData){
            if(isRawData1Empty){
                return null;
            }
            rawData = '{}';
        };
        rawData = JSON.parse(rawData);
        $.extend(rawData,rawData1);
        if (rawForm) {
            return rawData;
        };
        var tags = [];
        for(var c in rawData){
            tags.push(rawData[c]);
        };
        return tags;
    };
    /**
     * 获取自定义tag数据
     * @params {String} id tag编号
     */
    pub.getCTag = function(id){
        var d = pub.getCTags(true)||{};
        d = d[id]||pub.getDefaultCTagById(id);
        return d;
    };
    /**
     * 保存自定义tag数据
     * @params {Object} tagData tag数据
     */
    pub.saveCTag = function(tagData){
        var d = pub.getCTags(true)||{},
            isNew = false;
        if(tagData.id==''){
            tagData.id = new Date().getTime();
        };
        if(!pub.getCTag(tagData.id)){
            isNew = true;
        };
        d[tagData.id]=tagData;
        var key = 'wgdata_ctags_'+pub.bizInfo.pid;
        localStorage[key]=JSON.stringify(d);
        J.$win.trigger(pub.EVT.CTagUpdated,[(isNew?0:1),tagData]);
        return d;
    };
    /**
     * 删除自定义tag数据
     * @params {String} id tag id
     */
    pub.deleteCTag = function(id){
        var d = pub.getCTags(true);
        if(!d){
            return null;
        };
        if(!d[id]){
            return d;
        };
        delete d[id];
        var key = 'wgdata_ctags_'+pub.bizInfo.pid;
        localStorage[key]=JSON.stringify(d);
        J.$win.trigger(pub.EVT.CTagUpdated,[-1,id]);
        return d;
    };
